import React from 'react'

export default function Sidebar(props) {
  return (
    <section clasName="pane sidebar">
        <div className="sidebar-header">
            <h3>My Quizzes</h3>
            <button className="new-quiz">+</button>
        </div>
        {props.quizzes}
    </section>
  )
}
